import React, { useState } from 'react';
import './RegistrationPopup.css';

const RegistrationPopup = ({ isOpen, onClose }) => {
  const [currentStep, setCurrentStep] = useState(1);

  const handleNextStep = () => {
    setCurrentStep((prevStep) => prevStep + 1);
  };

  const handlePrevStep = () => {
    setCurrentStep((prevStep) => prevStep - 1);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    alert('Registration successful!');
    onClose();
  };

  if (!isOpen) return null;

  return (
    <div className="reg-popup">
      <div className="reg-popup-content">
        <div className="reg-popup-header">
          <h2>Create an Account</h2>
          <button className="reg-close-btn" onClick={onClose}>Ã—</button>
        </div>
        <div className="reg-popup-body">
          <form id="reg-form" onSubmit={handleSubmit}>
            {currentStep === 1 && (
              <div className="reg-step reg-step-active">
                <h3>Step 1/2: Fill out your details</h3>
                <label htmlFor="reg-email">Email *</label>
                <input type="email" id="reg-email" name="reg-email" required />
                <label htmlFor="reg-username">Username *</label>
                <input type="text" id="reg-username" name="reg-username" required />
                <p>Your username must be 3-14 characters long.</p>
                <label htmlFor="reg-password">Password *</label>
                <input type="password" id="reg-password" name="reg-password" required />
                <label htmlFor="reg-dob">Date of Birth *</label>
                <div className="reg-dob-inputs">
                  <input type="text" id="reg-dob-day" placeholder="DD" maxLength="2" required />
                  <select id="reg-dob-month" required>
                    <option value="">Month</option>
                    <option value="1">January</option>
                    <option value="2">February</option>
                    {/* Add other months */}
                  </select>
                  <input type="text" id="reg-dob-year" placeholder="YYYY" maxLength="4" required />
                </div>
                <label htmlFor="reg-phone">Phone (Optional)</label>
                <div className="reg-phone-inputs">
                  <input type="text" id="reg-phone-code" placeholder="Country code" />
                  <input type="tel" id="reg-phone-number" placeholder="Phone number" />
                </div>
                <label htmlFor="reg-code">Code (Optional)</label>
                <input type="text" id="reg-code" name="reg-code" />
                <button type="button" className="reg-next-btn" onClick={handleNextStep}>Continue</button>
              </div>
            )}
            {currentStep === 2 && (
              <div className="reg-step reg-step-active">
                <h3>Step 2/2: Confirm your details</h3>
                <p>Review your details and confirm.</p>
                <button type="button" className="reg-back-btn" onClick={handlePrevStep}>Back</button>
                <button type="submit" className="reg-submit-btn">Register</button>
              </div>
            )}
          </form>
        </div>
      </div>
    </div>
  );
};

export default RegistrationPopup;
